from typing import List

class Solution:
    def lastVisitedIntegers(self, words: List[str]) -> List[int]:
        result = []
        nums = []
        prev_count = 0
        for word in words:
            if word.isdigit():
                nums.append(int(word))
                prev_count = 0
            else:
                if prev_count < len(nums):
                    result.append(nums[-(prev_count + 1)])
                else:
                    result.append(-1)
                prev_count += 1
        return result
